import React, { Component } from "react";
import "./List.css";

class List extends Component {
    render() {
        return (
            <span className = "list">
                <form className = "publisherList">
                    <input
                        type = "checkbox"
                        value = {this.props.name}
                        name = "isChecked"
                        onChange = {this.handleChecked}
                    />
                    <label>{this.props.name}</label>
                </form>
            </span>
        );
    }
}

export default List
